import Button from 'react-bootstrap/Button';
import React from 'react';
import '../styles.css';

const navBar = ({navBar}) => { 
    return(<div className="navBar">
        <Button variant="link" style={{objectPosition: "50px 10%"}}>{"Hello"}</Button>
        {/* <button style={{position: "relative", objectPosition: "700px 400px"}}>{"Hello 1"}</button> */}
        <button style={{position: "absolute", left: "20%", top: "40%"}}>{"Hello 1"}</button>
        <button>{"Hello 2"}</button>
    </div>) 
}

export default navBar;
